import Contact from './Contacts';
import Footer from './Footer';
import Services from './Services';
import './Start.css';

function Start() {
  useEffect(() => {
    // ... rest of the Start.js code
  }, []);

  return (
    <>
      <HomeButton />
      <Candidates />
      <Services />
      <About />
      <Contact />
      <Footer />
    </>
  );
}

export default Start;
